import { FC } from "react";
import { TodoData } from "../TodoData";
import Todo from './Todo';

type TodoListProps = {
  todos: TodoData[];
};

const TodoList: FC<TodoListProps> = ({ todos }) => {
  return (
    <div>
      <ul>
        {todos.map((todo) => (
          <li>
            <Todo/>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TodoList;
